	pub fn show_superiority_decision_controls(&mut self, end_contest: bool) {
		if end_contest {
			self.display.superiority_decision_lbl.set_label("Contest winner:");
		} else {
			self.keu_man_superiority_decision = true;
			self.display.superiority_decision_lbl.set_label(format!("Round {} winner:", self.round_number).as_str());
		}
		self.display.superiority_decision_lbl.show();
		self.controls.cheong_superiority_decision_btn.show();
		self.controls.hong_superiority_decision_btn.show();
	}
	
